import { observable, makeObservable, action } from 'mobx';
import generateId from '../../IDGenerator';

class ExStore {
  constructor() {
    makeObservable(this);
  }

  @observable
  data = [
    {
      id: 'root1',
      name: '티베로설치법',
      children: [
        {
          id: '1',
          name: '1',
          children: [
            {
              id: '8',
              name: '8',
            },
          ],
        },
        {
          id: '3',
          name: '3',
          children: [
            {
              id: '4',
              name: '4',
            },
          ],
        },
      ],
    },
    {
      id: 'root2',
      name: '티베로 삭제법',
      children: [
        {
          id: '5',
          name: '5',
        },
        {
          id: '6',
          name: '6',
          children: [
            {
              id: '7',
              name: '7',
            },
          ],
        },
      ],
    },
  ];

  @action
  funcAddRootUk() {
    let tmp = generateId(5);
    let object = {
      id: tmp,
      name: tmp,
    };
    this.data.push(object);
  }
}

export default new ExStore();
